import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

const LogoutForm = () => {
    const navigate = useNavigate();
    
    useEffect(() => {
        localStorage.removeItem('jwtToken');
        navigate('/login');
    }, [navigate]);
    
    return null;
};

export default LogoutForm;
